import React from 'react';
import NavBar from './NavBar';
import { Typography } from "@material-ui/core";

class Home extends React.Component {
    render() {
        return (
            <div>
                <Typography variant="h3" style={{alignContent: 'center'}}>Hello world</Typography>
                <NavBar />
            </div>
        );
    }
}

export default Home;
